description.text:
I made pauloblank's Math Spinner Enhanced (fast print, no support) for my cousins to play with at a party, they looked it over and said &quot;this should ratchet.&quot;  
Many hours of design later I've created a ratcheting math spinner. I've made the spinners thinner to print faster, and squeeze more into a reasonable total height. I added more operators and digits for more complex math. I also had to make a central core for the ratcheting mechanism, no more pvc pipe and reprinting to get the diameter right.<br />
Enjoy!
